column8:
愛嬌たっぷりの動物さんのリュックは遠足や習い事にぴったり!<br>
サイドにはボトルポケット付き。<br>
ストラップは調節可能だからお子さまの成長に合わせてぴったりサイズに!<br>
<br>
【サイズ】W29×D13×H30cm<br>
【重量】246g<br> 
【原産国】 中国<br>
【素材】本体:ポリエステル 引き手:ポリウレタン<br> 
【月齢】3歳から<br>
【お手入れ方法】<br>
・洗濯可(30℃以下の水で、手洗い)。洗濯の際、多少色落ちや色移りする可能性がありますので他のものと分けて洗ってください。<br>
・塩素系漂白剤と蛍光塗料入り洗剤は使用しないでください。<br>
・乾燥機・アイロンは使用しないでください。<br>
・洗濯後は、平らな場所で自然乾燥させてください。<!★★★★★かご上★★★★★-->



